// SPDX-License-Identifier: MIT
pragma solidity 0.8.28;

import "@openzeppelin/contracts/access/Ownable.sol";

/// @dev Interface for the Pencils Protocol staking contract.
interface IPencilsProtocol {
    function stake() external payable;
    function unstake(uint256 amount) external;
    function claimRewards() external returns (uint256);
}

contract YieldOptimizedSavings is Ownable {
    // Mapping to track user deposits in ETH.
    mapping(address => uint256) public deposits;
    uint256 public totalDeposits;

    // Pencils Protocol integration
    IPencilsProtocol public pencilsProtocol;

    event Deposited(address indexed user, uint256 amount);
    event Withdrawn(address indexed user, uint256 amount);
    event Invested(uint256 amount);
    event Harvested(uint256 rewards);

    constructor() Ownable(msg.sender) {}

    /// @notice Sets the address of the Pencils Protocol staking contract.
    function setPencilsProtocol(address _protocol) external onlyOwner {
        pencilsProtocol = IPencilsProtocol(_protocol);
    }

    /// @notice Deposits ETH and updates user balance.
    function deposit() external payable {
        require(msg.value > 0, "Cannot deposit zero ETH");

        deposits[msg.sender] += msg.value;
        totalDeposits += msg.value;

        emit Deposited(msg.sender, msg.value);
    }

    /// @notice Withdraws ETH from the contract.
    function withdraw(uint256 amount) external {
        require(deposits[msg.sender] >= amount, "Insufficient balance");
        deposits[msg.sender] -= amount;
        totalDeposits -= amount;

        (bool success, ) = msg.sender.call{value: amount}("");
        require(success, "ETH transfer failed");

        emit Withdrawn(msg.sender, amount);
    }

    /// @notice Invests available ETH into Pencils Protocol.
    function invest() external onlyOwner {
        require(address(pencilsProtocol) != address(0), "Pencils Protocol not set");
        require(address(this).balance > 0, "No ETH available for investment");

        uint256 balance = address(this).balance;

        // Send ETH to the Pencils Protocol for staking
        (bool success, ) = address(pencilsProtocol).call{value: balance}("");
        require(success, "Staking failed");

        emit Invested(balance);
    }

    /// @notice Harvests yield rewards from Pencils Protocol.
    function harvestYield() external onlyOwner {
        require(address(pencilsProtocol) != address(0), "Pencils Protocol not set");
        uint256 rewards = pencilsProtocol.claimRewards();

        emit Harvested(rewards);
    }

    /// @notice Allow contract to receive ETH.
    receive() external payable {}
}

